<!doctype html>
<html lang="en">
    <head>
        <meta charset="utf-8">
        <meta http-equiv="X-UA-Compatible" content="IE=edge">
        <meta name="viewport" content="initial-scale=1,user-scalable=no,maximum-scale=1,width=device-width">
        <meta name="mobile-web-app-capable" content="yes">
        <meta name="apple-mobile-web-app-capable" content="yes">
        <link rel="stylesheet" href="css/leaflet.css">
        <link rel="stylesheet" href="css/qgis2web.css"><link rel="stylesheet" href="css/fontawesome-all.min.css">
        <style>
        html, body, #map {
            width: 100%;
            height: 100%;
            padding: 0;
            margin: 0;
        }
        </style>
        <title></title>
    </head>
    <body>
        <div id="map">
        </div>
        <script src="js/qgis2web_expressions.js"></script>
        <script src="js/leaflet.js"></script>
        <script src="js/leaflet.rotatedMarker.js"></script>
        <script src="js/leaflet.pattern.js"></script>
        <script src="js/leaflet-hash.js"></script>
        <script src="js/Autolinker.min.js"></script>
        <script src="js/rbush.min.js"></script>
        <script src="js/labelgun.min.js"></script>
        <script src="js/labels.js"></script>
        <script src="data/Population_1.js"></script>
        <script>
        var map = L.map('map', {
            zoomControl:true, maxZoom:28, minZoom:1
        }).fitBounds([[24.99408925468534,121.52136416095298],[25.171909339110023,121.6965515114517]]);
        var hash = new L.Hash(map);
        map.attributionControl.setPrefix('<a href="https://github.com/tomchadwin/qgis2web" target="_blank">qgis2web</a> &middot; <a href="https://leafletjs.com" title="A JS library for interactive maps">Leaflet</a> &middot; <a href="https://qgis.org">QGIS</a>');
        var bounds_group = new L.featureGroup([]);
        function setBounds() {
        }
        var layer_OpenStreetMap_0 = L.tileLayer('https://tile.openstreetmap.org/{z}/{x}/{y}.png', {
            opacity: 1.0,
            attribution: '',
            minZoom: 1,
            maxZoom: 28,
            minNativeZoom: 0,
            maxNativeZoom: 19
        });
        layer_OpenStreetMap_0;
        map.addLayer(layer_OpenStreetMap_0);
        function pop_Population_1(feature, layer) {
            var popupContent = '<table>\
                    <tr>\
                        <th scope="row">Store Name</th>\
                        <td>' + (feature.properties['Store_Code'] !== null ? Autolinker.link(String(feature.properties['Store_Code'])) : '') + '</td>\
                    </tr>\
                    <tr>\
                        <th scope="row">POD_Code</th>\
                        <td>' + (feature.properties['POD_Code'] !== null ? Autolinker.link(String(feature.properties['POD_Code'])) : '') + '</td>\
                    </tr>\
                    <tr>\
                        <th scope="row">Population</th>\
                        <td>' + (feature.properties['Population'] !== null ? Autolinker.link(String(feature.properties['Population'])) : '') + '</td>\
                    </tr>\
                </table>';
            layer.bindPopup(popupContent, {maxHeight: 400});
        }

        function style_Population_1_0(feature) {
            if (feature.properties['Population'] >= 14265.000000 && feature.properties['Population'] <= 19661.000000 ) {
                return {
                pane: 'pane_Population_1',
                opacity: 1,
                color: 'rgba(35,35,35,1.0)',
                dashArray: '',
                lineCap: 'butt',
                lineJoin: 'miter',
                weight: 1.0, 
                fill: true,
                fillOpacity: 1,
                fillColor: 'rgba(247,251,255,1.0)',
                interactive: true,
            }
            }
            if (feature.properties['Population'] >= 19661.000000 && feature.properties['Population'] <= 25057.000000 ) {
                return {
                pane: 'pane_Population_1',
                opacity: 1,
                color: 'rgba(35,35,35,1.0)',
                dashArray: '',
                lineCap: 'butt',
                lineJoin: 'miter',
                weight: 1.0, 
                fill: true,
                fillOpacity: 1,
                fillColor: 'rgba(200,221,240,1.0)',
                interactive: true,
            }
            }
            if (feature.properties['Population'] >= 25057.000000 && feature.properties['Population'] <= 30453.000000 ) {
                return {
                pane: 'pane_Population_1',
                opacity: 1,
                color: 'rgba(35,35,35,1.0)',
                dashArray: '',
                lineCap: 'butt',
                lineJoin: 'miter',
                weight: 1.0, 
                fill: true,
                fillOpacity: 1,
                fillColor: 'rgba(115,179,216,1.0)',
                interactive: true,
            }
            }
            if (feature.properties['Population'] >= 30453.000000 && feature.properties['Population'] <= 35849.000000 ) {
                return {
                pane: 'pane_Population_1',
                opacity: 1,
                color: 'rgba(35,35,35,1.0)',
                dashArray: '',
                lineCap: 'butt',
                lineJoin: 'miter',
                weight: 1.0, 
                fill: true,
                fillOpacity: 1,
                fillColor: 'rgba(40,121,185,1.0)',
                interactive: true,
            }
            }
            if (feature.properties['Population'] >= 35849.000000 && feature.properties['Population'] <= 41245.000000 ) {
                return {
                pane: 'pane_Population_1',
                opacity: 1,
                color: 'rgba(35,35,35,1.0)',
                dashArray: '',
                lineCap: 'butt',
                lineJoin: 'miter',
                weight: 1.0, 
                fill: true,
                fillOpacity: 1,
                fillColor: 'rgba(8,48,107,1.0)',
                interactive: true,
            }
            }
        }
        map.createPane('pane_Population_1');
        map.getPane('pane_Population_1').style.zIndex = 401;
        map.getPane('pane_Population_1').style['mix-blend-mode'] = 'normal';
        var layer_Population_1 = new L.geoJson(json_Population_1, {
            attribution: '',
            interactive: true,
            dataVar: 'json_Population_1',
            layerName: 'layer_Population_1',
            pane: 'pane_Population_1',
            onEachFeature: pop_Population_1,
            style: style_Population_1_0,
        });
        bounds_group.addLayer(layer_Population_1);
        map.addLayer(layer_Population_1);
        var baseMaps = {};
        L.control.layers(baseMaps,{'Population<br /><table><tr><td style="text-align: center;"><img src="legend/Population_1_14265196610.png" /></td><td>14265 - 19661</td></tr><tr><td style="text-align: center;"><img src="legend/Population_1_19661250571.png" /></td><td>19661 - 25057</td></tr><tr><td style="text-align: center;"><img src="legend/Population_1_25057304532.png" /></td><td>25057 - 30453</td></tr><tr><td style="text-align: center;"><img src="legend/Population_1_30453358493.png" /></td><td>30453 - 35849</td></tr><tr><td style="text-align: center;"><img src="legend/Population_1_35849412454.png" /></td><td>35849 - 41245</td></tr></table>': layer_Population_1,"OpenStreetMap": layer_OpenStreetMap_0,}).addTo(map);
        setBounds();
        </script>
    </body>
</html>
